INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (30701, 28989, 'Vardenafil', 'Hearing Loss', 'Use of phosphodiesterase-5 (PDE5) inhibitors has been associated with sudden decrease or loss of hearing, which may be accompanied by tinnitus or dizziness.  Patients with hearing problems should stop taking these agents and seek prompt medical care.', '2', '', 'DDInter', 0);
