INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (30784, 7255, 'Vardenafil', 'Liver Diseases', 'Vardenafil is cleared predominantly by hepatic metabolism.  The pharmacokinetic disposition of this agent has not been assessed in patients with severe hepatic impairment.  No dosage modification is recommended for patients with mild hepatic impairment, however, therapy with this agent should not be administered to patients with moderate to severe hepatic impairment.  In patients with mild hepatic impairment a lower dose of the oral tablet might be used as initial therapy and the maximum dose should not exceed 10 mg.', '2', '', 'DDInter', 0);
